INSERT INTO `kayapo_bbposts_text` VALUES (2,'f61a448595','O Cão é o espelho do dono?','Você concorda com a tese de que o Cão é espelho do dono. Ou seja, um reflexo daquilo que lhe foi ensinado? As Raças como Pit Bull só saõ agressivas se assim seu donoi desejar? Esse será o tema do programa \"Comunidade em Ação\" nesta segunda dia 05 de setembro. Em debate as 15h30 - Criadores de cães, adestradores e veterinários estarão discutindo esse assunto.');
