INSERT INTO `kayapo_bbprivmsgs_text` VALUES (117,'d415941f8c','Ao acessar o site www.luzealegria.com.br você tem duas opções:\r\n1-Ouvir as emissoras(AM-1160 ou 95.9FM) pelo Winamp, estando localizado na parte central do site com o seu identificador, bastando clicar e ouvir.(Para isso deve ter o Winamp instalado em sua máquina)\r\n\r\n2-Pode localizar o ícone ONLINE no canto direito do vídeo, sendo que ao clicar no ONLINE abrirá uma janela onde você deve escolher qual a Rádio que deseja ouvir. Caso escolha a AM, você abrirá o audio juntamente com a imagem do stúdio, bastando apenas clicar no logo da Rádio desejada. Se escolher a 95.9FM, da mesma maneira anterior o audio abrirá pelo Winamp.\r\n\r\nQualquer dúvida entre em contato pelo fone (55)3744-3700 e fale com o Maurício, responsável por este setor.\r\n\r\nAtenciosamente, Marco Maciel - Diretor Geral Rádios Luz e Alegria AM e 95.9FM.');
