INSERT INTO `kayapo_events` VALUES (13,'luzealegria','Festas São João do Porto','2005-10-11 10:57:51','As melhores festas de final de ano, as melhores Bandas, a melhor estrutura  no So Joo do Porto. Dia 25 de Dezembro festa de Natal com as Bandas Legal e Cosmo Express.<br />\r\nDia 14 de Janeiro de 2006, festival do Chopp com grupo momento. Rena a galera e v se divertir no So Joo do Porto.',0,0,4,'Nega','2005-12-25','2005-12-25','00:00:00','12:00:00',0,'r');
INSERT INTO `kayapo_events` VALUES (14,'luzealegria','7º Festival do Chopp Distrito São Paulo','2005-10-11 14:47:21','A maior exploso do Sul do Pas, San Marino e Banda Herdeiros. Dia 05 de Novembro no Distrito de So Paulo - Vista Alegre. 8 horas de msica, durante o baile sorteio de R$ - 1.000,00 em dinheiro e um barril de chopp, sorteio pelo bingo.<br />\r\ncompleto servio de segurana, ginsio totalmente ampliado.<br />\r\nIngressos antecipados em Frederico Westphalen, no Cantinho do Som e Livraria Universitria; em Palmitinho no Solar dos Pltanos; em Caiara, no Point Bar e Pizzaria e em Seberi no Camorras.<br />\r\n',0,0,4,'Cleci','2005-11-05','2005-11-05','00:00:00','12:00:00',0,'r');
