INSERT INTO `kayapo_events` VALUES (16,'luzealegria','Festival do Chopp em Vista Alegre','2005-11-01 14:43:24','36 Festival do Chopp no Clube Sol da Amrica em Vista Alegre, dia 31 de Dezembro com animao da Banda Cosmos Express.<br />\r\nSorteio de R$ - 300,00 e R$ - 500,00 em dinheiro e a 1 Barril de Chopp de 30 litros.<br />\r\nEssa voc no pode perder!',0,0,4,'Anonymous','2005-12-31','2005-12-31','00:00:00','12:00:00',0,'r');
