INSERT INTO `kayapo_events` VALUES (20,'luzealegria','8º Festival do Chopp em Pinheirinho do Vale','2005-12-16 11:06:33','8 Festival do Chopp no Salo Paroquial de Pinheirinho do Vale, dia 30 de Dezembro, 8hs de animao, com a Super Banda 2001 a \"Banda do Bonde do Alemo\" e Banda Herdeiros<br />\r\nMesa livre, reserve seu Barril de Chopp e venha fazer a festa.<br />\r\nPinheirinho do Vale lhe espera com muito chopp e animao!',0,0,4,'Anonymous','2005-12-30','2005-12-31','09:00:00','17:00:00',0,'r');
INSERT INTO `kayapo_events` VALUES (21,'luzealegria','Festa Padroeira Linha Canela','2006-01-12 15:01:43','Festa da Padroeira no dia 15 de Janeiro na Linha Canela - Caiara. <br />\r\nDias, 11, 12 e 13 de Janeiro haver trduo s 20:30h.<br />\r\nDia 15 s 10:00h missa, ao meio-dia almoo. Vendas de ingressos antecipados para o almoo com os membroas da comunidade.<br />\r\n tarde reunio danante com a Banda Herdeiros e entrada franca.<br />\r\n',0,0,4,'Anonymous','2006-01-15','2006-01-15','09:00:00','23:00:00',0,'r');
INSERT INTO `kayapo_events` VALUES (22,'luzealegria','Festa Padroeiro Linha Pardinho','2006-01-12 15:20:13','Festa do Padroeiro So Joo Bosco no dia 12 de Fevereiro na Linha Pardinho.<br />\r\nDias 08, 09 e 10/02 trduo preparatrio s 20:00h.<br />\r\ndia 12 s 06:00h alvorada festiva, s 10:00h missa e procisso com o Padroeiro.<br />\r\nAps, jogo entre o time Veterano Sol D\'Amrica e Guarani da Linha Boa Esperana.<br />\r\nAo meio-dia Churrasco, bebidas e saladas.<br />\r\n tarde continuao dos jogos.<br />\r\n15:30h, reunio danante com a Banda Doce Luar de Seberi.',0,0,4,'Cleci','2006-02-12','2006-02-12','09:00:00','00:00:00',0,'r');
INSERT INTO `kayapo_events` VALUES (23,'luzealegria','3º Festival do Chopp em Laranjeiras','2006-01-12 15:27:57','Vem a pela 1 vez em Laranjeiras a Banda Indexo que animar o terceiro festival do chopp no dia 21 de Janeiro com incio s 23:00h no Salo Paroquial.<br />\r\nReservas de barris de Chopp e ingressos antecipados com os membros do Conselho da Capela e do grupo de jovens.<br />\r\nBarril de 30 litros  R$ - 200,00.<br />\r\n',0,0,4,'Cleci','2006-01-21','2006-01-21','09:00:00','00:00:00',0,'r');
INSERT INTO `kayapo_events` VALUES (24,'luzealegria','Romaria em Osvaldo Cruz','2006-01-12 15:47:33','33 Romaria de Nossa Senhora de Lourdes e 8 Romaria Diocesana do Enfermo em Osvaldo Cruz dia 12 de Fevereiro.<br />\r\nde 02  10/02 novena s 20:00h.<br />\r\ndia 12, dia da romaria, s 06:00h missa para os trabalhadores.<br />\r\n09:00h - recepo aos enfermos;<br />\r\n10:00h - Missa solene;<br />\r\n11:00h - Procisso e bno da Sade;<br />\r\n12:00h - Almoo;<br />\r\nParticipem!!!',0,0,4,'Cleci','2006-02-12','2006-02-12','09:00:00','12:00:00',0,'r');
