INSERT INTO `kayapo_events_comments` VALUES (37,25,'SÓ FALTAM 15 DIAS!!!\r\nCASTELINHO VAI TREMER!!!É a 30edição do mais tradicional festival do chopp da região,é imperdivel.(se não fosse bom,não chegaria até aqui!!!São 30anos,30edições,30 grandes bailes,venha você tambem fazer parte dessa hist','2006-01-28 09:59:41','DIEGO');
INSERT INTO `kayapo_events_comments` VALUES (38,25,'Uma ampla estrutura vai ser montada para poder lhe atender ainda melhor.Venha conferir e se divertir muito!!!','2006-01-30 16:21:57','Equipe de organização');
INSERT INTO `kayapo_events_comments` VALUES (39,24,'Eu gostaria muito de participar,como já participei nos outros anos,mas no sábado a noite terá um grande festival do chopp em Castelinho, dai já viu né!!!\r\nNo outro dia vai ser a resaca.Um grande abraço ao pessoal de Osvaldo Cruz','2006-01-31 11:32:26','');
INSERT INTO `kayapo_events_comments` VALUES (40,25,'com certeza, nós  se faremos presente nesta fésta, a distância não vai ser obstáculo para mim, ja esteve em bailes ai é 10','2006-01-31 18:24:18','ADENIR MONTANARI');
INSERT INTO `kayapo_events_comments` VALUES (41,25,'Minha turma sempre vai e adora,este ano vou junto,e por conselho deles já comprei meu ingresso antecipado para não ficar fora dessa festa.Valeu','2006-02-01 16:50:28','Priscila');
INSERT INTO `kayapo_events_comments` VALUES (42,25,'Eu quero brincar de tomar chopp!!!\r\nPara isso já to levando até um motorista junto.Toda vez que vou a Castelinho em bailes do chopp,eu costumo voltar cedo para casa, (7:00hrs da manha).','2006-02-01 16:56:54','BETO');
INSERT INTO `kayapo_events_comments` VALUES (43,25,'Pessoal,lá vale a pena!!!Vá uma vez e confira,é um verdadeiro baile do chopp.','2006-02-01 16:59:11','BETO');
INSERT INTO `kayapo_events_comments` VALUES (44,26,'   Esse show vai ser show.Vou ir em todos, mas o principal vai ser BIQUINI CAVADÃO.','2006-02-02 16:57:42','Elaine');
INSERT INTO `kayapo_events_comments` VALUES (45,25,'Gosto muito de ir a Castelinho,lá é super divertido.','2006-02-03 11:54:19','DULCE');
INSERT INTO `kayapo_events_comments` VALUES (46,25,'A espectativa para está 30edição do festival do chopp em Castelinho,é superar a venda de chopp e de publico dos outros anos,ou seja,vender aproximadamente 5.000 litros de chopp e ultrapassar de 2.000 ingressos vendidos.Baseado na venda antecipada essa','2006-02-03 15:04:07','DIEGO MATIAS');
INSERT INTO `kayapo_events_comments` VALUES (47,25,'','2006-02-03 15:05:19','');
INSERT INTO `kayapo_events_comments` VALUES (48,25,'Venha conferir a melhor festa do chopp da região, com o maior público e animação não fique de fora é chopp e dança de montão com abanda mais tradicional do chopp OS MONTANARI. VENHA CONFERIR!','2006-02-03 20:51:40','Tiane');
INSERT INTO `kayapo_events_comments` VALUES (49,25,'Essa é a ultima semana,para O MAIOR FESTVAL DO CHOPP da região.Garanta seu ingresso antecipado nos pontos de venda,e venha se divertir com a gente!!!','2006-02-06 17:48:34','Marcio');
INSERT INTO `kayapo_events_comments` VALUES (50,25,'O grande público sempre vai está presente em Castelinho!!!mas esse ano eu quase fiquei fora dessa grande festa,porque a divulgação é muito pouca!!!','2006-02-08 17:45:55','XXXXXXXX');
INSERT INTO `kayapo_events_comments` VALUES (51,25,'Quero aproveitar convidar à todos vocês para ir nessa festa(lá a gente se sente em casa,e o grande espaço,torna a festa mais agradavel!!!)','2006-02-08 17:49:12','XXXXXXX');
INSERT INTO `kayapo_events_comments` VALUES (52,25,'Demorou,mas chegou a hora!!!\r\nCastelinho me aguarde amanha no grande festival do chopp.Valeu pessoal','2006-02-10 11:35:12','');
INSERT INTO `kayapo_events_comments` VALUES (53,25,'A comunidade de Castelinho quer lhe convidar para a 30edição do festival do chopp,que será neste dia 11/02.(para o próximo ano Castelinho trará uma banda que nunca tocou na região.Aguardem...','2006-02-10 11:39:36','');
INSERT INTO `kayapo_events_comments` VALUES (54,25,'Hoje é o grande dia!!!!!!!!O maior fastival do chopp vem ai!!!!!!!!!!É hoje à noit em Castelinho,não perca essa festa.(hoje a tarde estará sendo vendidos os ultimos ingressos antecipados na praça da matriz.Garanta o seu\r\n','2006-02-11 09:57:31','');
INSERT INTO `kayapo_events_comments` VALUES (55,25,'A COMUNIDADE DE CASTELINHO VEM POR MEIO DESTE,AGRADECER A TODOS QUE PARTICIPARAM E COLABORARÃO DA 30EDIÇÃO DO FESTIVAL DO CHOPP DE CASTELINHO.COMO NOS OUTROS ANOS,ESSE TAMBÉM FOI UM GRANDE SUCESSO.DESTE DE JÁ QUERO CONVIDAR VC PARA \'PARTICIPAR COM A ','2006-02-13 11:47:03','');
INSERT INTO `kayapo_events_comments` VALUES (56,26,'Já participei outros anos e gostei,então esse ano estarei lá de novo!!!É uma pena que o melhor show(BIQUINI CAVADÃO)ficou na sexta feira é dificil de participar para quem tem que trabalhar no sábado.Quero estar presente em todos,tomare que isso sej','2006-02-13 11:58:57','Diego Matias');
INSERT INTO `kayapo_events_comments` VALUES (57,25,'Quero parabenizar à comunidade de Castelinho por mais este grande sucesso, que foi o festival do chopp,que ocorreu neste dia 11/02/06.Me diverti muito como nos outros anos,e agora vou aguardar o próximo festival do chopp em Castelinho!!!','2006-02-14 17:16:20','');
INSERT INTO `kayapo_events_comments` VALUES (58,25,'O presidente Claudio Cargnim em nome da comunidade de Castelinho,vem agradecer a todos os que participaram da 30edição do festival do chopp.Desde de já a gente quer convidar voçê para a 31edição do festival do chopp que será no dia 10/02/07.Partic','2006-02-14 17:24:21','');
INSERT INTO `kayapo_events_comments` VALUES (59,26,'Bom ja participei outras vazes pretendo ir novamente mas estou morando em Florianopolis sc vou levar a minha galera porque o show é dez e eu amo essa lugar.','2006-02-21 15:05:48','eliandra');
