INSERT INTO `kayapo_events_comments` VALUES (70,26,'gente eu fui todos os dias na expopedras , foi mto massa, e quero destacar aki os shows da banda Apocalipse, q sempre encerravam no segundo palco, eles simplesmente sao demais , merecem um grande destaque aki tb como atraçao. parabens AMETISTA DO SUL','2006-03-24 15:19:51','elis');
